import { Container } from "@mui/material";
import React, { useState, useEffect } from "react";
import "./App.css";
import Axios from "axios";
import Post from "./components/Post";

function App() {
  const [APOD, setAPOD] = useState([]);

  useEffect(() => {
    Axios.get(
      "https://api.nasa.gov/planetary/apod?api_key=ge9zXukzme64aq3NwaMD4fVSNsNfu1R7cvsWVFq7&start_date=2021-06-22&end_date=2021-06-25"
    ).then((response) => {
      console.log(response.data);
      setAPOD(response.data);
    });
  }, []);

  return (
    <div className="App">
      <Container maxWidth="sm">
        {APOD.map((data) => (
          <Post data={data}></Post>
        ))}
        <br></br>
        <br></br>
      </Container>
    </div>
  );
}

export default App;
